import React, {Component} from 'react';
import SideMenu from '/sideMenu';
import Navbar from './nav';

class Root extends Component {
    render(){
        return(
            <div>
                <div><SideMenu /></div>
                <div><Navbar /></div>
            </div>
        );
    }
}   

export default Root;
